import React from "react";
import { useLocation } from 'react-router-dom'
import { useParams } from "react-router-dom";
const Detail = () => {
    const {id} = useParams();
    const location = useLocation();
    const {cardId} = location.state;
    return (
        <>
            <h1>{cardId}</h1>
        </>
    );
}
export default Detail;
